(1, 350, 'Muat dan bongkar kabel dalam haspel ke dan dari moda angkutan', '<p>Pokok kegiatan :</p>\r\n\r\n<ul>\r\n	<li>menaikan kawat (baru dan bekas) ke angkutan</li>\r\n	<li>menurunkan kawat (baru dan bekas) dari angkutan</li>\r\n</ul>\r\n\r\n<p>Analisa biaya</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>kebutahn</td>\r\n			<td>satuan</td>\r\n			<td>indeks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PERKERJA</td>\r\n			<td>HO</td>\r\n			<td>4.00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ketreangan : jika butuh alat bantu dalam proses pengangkutan seperti tali, kawal dll dimasukan dalam analisa bahan</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
(2, 2, 'angkutan kawat (baru dan bekas) dengan pikulan dari dan ke stasiun pengumpulan lokasi peke', '<p>Pokok kegiatan :</p>\r\n\r\n<ul>\r\n	<li>membawa&nbsp;kawat ke lokasi</li>\r\n	<li>membawa kawat dari lokasi ke sta pengumpul</li>\r\n</ul>\r\n\r\n<p>Analisa biaya</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>kebutahn</td>\r\n			<td>satuan</td>\r\n			<td>indeks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PERKERJA</td>\r\n			<td>HO</td>\r\n			<td>8.00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ketreangan : jika butuh alat bantu dalam proses pengangkutan seperti tali, kawal dll dimasukan dalam analisa bahan</p>\r\n'),
(3, 3, 'Muat dan bongkar kabel dalam haspel ke dan dari moda angkutan', '<p>Pokok kegiatan :</p>\r\n\r\n<ul>\r\n	<li>menaikan kebel ke angkutan</li>\r\n	<li>menurunkan dari angkutan</li>\r\n</ul>\r\n\r\n<p>Analisa biaya :</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>kebutahn</td>\r\n			<td>satuan</td>\r\n			<td>indeks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PERKERJA</td>\r\n			<td>HO</td>\r\n			<td>8.00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ketreangan : jika butuh alat bantu dalam proses pengangkutan seperti tali, kawal dll dimasukan dalam analisa bahan</p>\r\n'),
(4, 351, 'Angkutan kabel dalam haspel dari stasiun/lokasi pengumpul ke lokasi pekerjaan1', '<p>Pokok kegiatan :</p>\r\n\r\n<ul>\r\n	<li>membawa kabel ke lokasi pekerjaan2</li>\r\n</ul>\r\n\r\n<p>Analisa biaya</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>kebutahn</td>\r\n			<td>satuan</td>\r\n			<td>indeks</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PERKERJA</td>\r\n			<td>HO</td>\r\n			<td>12.00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Ketreangan : jika butuh alat bantu dalam proses pengangkutan seperti tali, kawal dll dimasukan dalam analisa bahan</p>\r\n'),
(19, 347, 'Treat transformator minyak', '<p><strong>A. Setting alat sirkulasi minyak</strong></p>\r\n\r\n<p><strong>Pokok kegiatan :</strong></p>\r\n\r\n<ul>\r\n	<li>menyiapkan bantalan kayu untuk kedudukan alat</li>\r\n	<li>memasang slang untuk sirkulasi minyak transformator</li>\r\n	<li>menyiapkan tangki sirkulasi</li>\r\n	<li>setting parameter alat treatment</li>\r\n</ul>\r\n\r\n<p><strong>Analisa biaya :</strong></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>KEBUTUHAN</td>\r\n			<td>SATUAN</td>\r\n			<td>INDEKS</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TENAGA AHLI</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td style=\"text-align:center\">0.25</td>\r\n		</tr>\r\n		<tr>\r\n			<td>SUPERVISOR</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td style=\"text-align:center\">0.25</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TEKNISI</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td style=\"text-align:center\">0.25</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PEMBANTU TEKNISI</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td style=\"text-align:center\">1.00</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PEKERJA</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td style=\"text-align:center\">1.00</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),
(20, 20, '', '<p><strong>B. Treatment/filtering minyak</strong></p>\r\n\r\n<p><strong>pokok kegiatan :</strong></p>\r\n\r\n<ul>\r\n	<li>Memadamkan sementara transformator yang akan</li>\r\n	<li>Memasang selang sirkulasi treament ke transformator</li>\r\n	<li>memasang parameter treatment</li>\r\n	<li>mengoprasikan peralatan treatment</li>\r\n	<li>mengontrol kinerja peralatan treatment setiap 1 jam</li>\r\n	<li>Treatment minyak trafo</li>\r\n</ul>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:300px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>KEBUTUHAN</td>\r\n			<td>SATUAN</td>\r\n			<td>INDEKS</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TENAGA AHLI</td>\r\n			<td style=\"text-align: center;\">HO</td>\r\n			<td style=\"text-align: center;\">0.01</td>\r\n		</tr>\r\n		<tr>\r\n			<td>SUPERVISOR</td>\r\n			<td style=\"text-align: center;\">HO</td>\r\n			<td style=\"text-align: center;\">0.01</td>\r\n		</tr>\r\n		<tr>\r\n			<td>TEKNISI</td>\r\n			<td style=\"text-align: center;\">HO</td>\r\n			<td style=\"text-align: center;\">0.02</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PEMBANTU TEKNISI</td>\r\n			<td style=\"text-align: center;\">HO</td>\r\n			<td style=\"text-align: center;\">0.02</td>\r\n		</tr>\r\n		<tr>\r\n			<td>PEKERJA</td>\r\n			<td style=\"text-align: center;\">HO</td>\r\n			<td style=\"text-align: center;\">0.02</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),
(29, 340, '', '<p>Untuk setiap m3 balas batu pecah.</p>\r\n\r\n<p>bahan :</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>1.0</td>\r\n			<td style=\"text-align:center\">m3</td>\r\n			<td>Balas batu pecah uk. 2/6 cm di depo balas</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Upah :</p>\r\n\r\n<ol start=\"1\" style=\"list-style-type:lower-alpha\">\r\n	<li>Ongkos muat ke gerbong dengan loader</li>\r\n	<li>Ongkos muat ke gerbong dengan orang</li>\r\n</ol>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td style=\"text-align:center\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.330</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>Pekerjaan</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<ol start=\"3\" style=\"list-style-type:lower-alpha\">\r\n	<li>Ongkos angkut</li>\r\n</ol>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td style=\"text-align:center\">&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>1.50</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>Ongkos angkut KA*</td>\r\n		</tr>\r\n		<tr>\r\n			<td>1.50</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>Ongkos angkutan dengan truck</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:40px\">untuk material yang diangkut dengan truck Di sesuaikan dengan tarif pemerintah daerah (dari quary ke lokasi pekerjaan)</p>\r\n\r\n<p style=\"margin-left:40px\">*(surat edaran direksi) Poin a, b dan c merupakan pilihan</p>\r\n\r\n<ol