(31, 34, 'B. 1 Membuang balas kotor dengan jarak maks. 30 m', '<ul>\r\n	<li>Telah selesai diayak, balas bersih telah dimasukan kembali.</li>\r\n</ul>\r\n\r\n<p style=\"margin-left: 40px;\">Untuk setiap 1 m3</p>\r\n\r\n<p>Upah :</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\">INDEKS</td>\r\n			<td style=\"text-align: center;\">SATUAN</td>\r\n			<td style=\"text-align: center;\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.010</td>\r\n			<td style=\"text-align: center;\">OH</td>\r\n			<td>Mandor</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.330</td>\r\n			<td style=\"text-align: center;\">OH</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),
(32, 35, '2. Membuang balas kotor dengan jarak > 30m max 150m', '<ul>\r\n	<li>Untuk setiap 1 m3 pembuangan tanah sejauh 150m (An. SNI - revisi 6.8.1)</li>\r\n</ul>\r\n\r\n<p>Upah :</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\">INDEKS</td>\r\n			<td style=\"text-align: center;\">SATUAN</td>\r\n			<td style=\"text-align: center;\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.516</td>\r\n			<td style=\"text-align: center;\">OH</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.050</td>\r\n			<td style=\"text-align: center;\">OH</td>\r\n			<td>Mandor</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),
(33, 36, 'C. Memasukan balas kricak baru dan memecok sampai dapat dlalui KA', '<ul>\r\n	<li>Memasukan geotextile</li>\r\n	<li>Memasukan balas kricak baru, balas telah tersedia di tubuh jalan.</li>\r\n	<li>Mendandang/memecok untuk kec. KA 5 km/jam.</li>\r\n</ul>\r\n\r\n<p>Upah :</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td style=\"text-align:center\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.08200</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td>Mandor</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.45550</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Bahan :</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align: center;\">INDEKS</td>\r\n			<td style=\"text-align: center;\">SATUAN&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.33340</td>\r\n			<td style=\"text-align: center;\">m2</td>\r\n			<td>Menghampar geotextile lebar 3 meter</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n'),
(34, 37, 'Perhitungan balas pasir', '<p>Untuk setiap 1 m3 balas pasir</p>\r\n\r\n<p>Bahan:</p>\r\n\r\n<ol start=\"1\" style=\"list-style-type:lower-alpha\">\r\n	<li>\r\n	<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n		<tbody>\r\n			<tr>\r\n				<td>INDEKS</td>\r\n				<td>SATUAN</td>\r\n				<td>&nbsp;</td>\r\n			</tr>\r\n			<tr>\r\n				<td>1.0</td>\r\n				<td>m3</td>\r\n				<td>Harga balas pasir di quary</td>\r\n			</tr>\r\n		</tbody>\r\n	</table>\r\n	</li>\r\n</ol>\r\n\r\n<p>Upah :</p>\r\n\r\n<p style=\"margin-left:40px\">b 1. Ongkos muat ke gerbong dengan loader</p>\r\n\r\n<p style=\"margin-left:40px\"><span style=\"font-size:13px\">&nbsp; &nbsp;2. Ongkos muat ke gerbong dengan orang</span></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td style=\"text-align:center\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.13330</td>\r\n			<td style=\"text-align:center\">HO</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:40px\">c. Ongkos bongkar dan ecer dilokasi</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td style=\"text-align:center\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.0030</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>MANDOR</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.11667</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"margin-left:80px\">*Disesuaikan dengan kondisi tempat</p>\r\n\r\n<p style=\"margin-left:40px\">d. Memasukan balas pasi baru</p>\r\n\r\n<ul>\r\n	<li style=\"margin-left: 40px;\">Memasukan balas pasir, balas telah tersediadi tubuh jalan</li>\r\n	<li style=\"margin-left: 40px;\">mendandang/memecok untuk kec. KA 5 km/jam</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:80px\">Untuk setiap 1 m3</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"text-align:center\">INDEKS</td>\r\n			<td style=\"text-align:center\">SATUAN</td>\r\n			<td style=\"text-align:center\">KEBUTUHAN</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.23210</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>Mandor</td>\r\n		</tr>\r\n		<tr>\r\n			<td>0.69640</td>\r\n			<td style=\"text-align:center\">OH</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Bila diangkut dengan KA berlaku ongkos angkutan sama dengan analisa No.1</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
