(38, 41, 'c. Membuang balas kotor dengan jarak > 30m', '<ul>\r\n	<li>Untuk upah 1 m3. updah dan pengawasan, kerusakan alat dan bambu dihitung terpisah (mukomoko) untuk setiap 1 m3 dihitung dengan rumus :</li>\r\n</ul>\r\n\r\n<p style=\"margin-left: 40px;\">K = biaya tiap m3 (Rp)</p>\r\n\r\n<p style=\"margin-left: 40px;\">a = Upah pekerja (Rp)</p>\r\n\r\n<p style=\"margin-left: 40px;\">L = jarak pengangkutan (m)</p>\r\n\r\n<p style=\"margin-left: 40px;\"><span class=\"marker\">K = a(L+75)/424</span></p>\r\n\r\n<p style=\"margin-left: 40px;\">jarak pengangkutan ( &gt; 30m )</p>\r\n\r\n<p style=\"margin-left: 40px;\">&nbsp;</p>\r\n'),
