(183, 186, 'N. Timbunan porous (Batu pecah dan pasir) / bahan penyaring (filter)', '<p>Catatan :</p>\r\n\r\n<ol>\r\n	<li>Satuan dapat berdasarkan atas jam oprasi untuk tenaga kerja dalam peralatan, volume dan/atau ukuran berat untuk bahan-bahan.</li>\r\n	<li>Kuantiitas satuan adalah kuantitas perkiraan setiap komponen untuk menyelesaikan satu satuan pekerjaan dari nomor mata pembayaran. harga satuan yang disampaikan penyedia jasa tidak dapat dibubah keceuali terdapat penyesuaian harga (eksalasi/deskalasi) sesuai ketentuan dalam instruksi kepada peserta lelang</li>\r\n	<li>Biaya satuan untuk peralatan sudah termasuk bahan bakar, bahan habis pakai dan operator</li>\r\n	<li>biaya satuan sudah termasuk pengeluaran untuk seluruh pajak yang berkaitan (tetapi tidak termasuk PPN yang dinayar dari komtrak) dan biaya-biaya lainya</li>\r\n</ol>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:350px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"height:27px; width:29px\">&nbsp;</td>\r\n			<td colspan=\"2\" style=\"width:138px\">Untuk tiap 1 m3</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>Upah</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>0.40</td>\r\n			<td>oh</td>\r\n			<td>Pekerja</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>0.10</td>\r\n			<td>oh</td>\r\n			<td>&nbsp;Mandor</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>Bahan</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>0.550</td>\r\n			<td>&nbsp;m3</td>\r\n			<td>Agregat Kasar</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"height:27px\">&nbsp;</td>\r\n			<td>0.550</td>\r\n			<td>&nbsp;m3</td>\r\n			<td>Pasir</td>\r\n		<